pattern = r"\|\s*\{\{flagg\|[^|]+\|pref=Demographics of\|([^\}]+)\}\}.*?\|\s*style=\"background:#e0ffd8;\"\|\s*([\d.]+)"

matches = re.findall(pattern, data, re.DOTALL)

# Step 2: Build dictionary with ranks and life expectancies
countries = {country: [i + 1, float(life_exp)] for i, (country, life_exp) in enumerate(matches)}

# Step 3: Print nicely
for name, info in countries.items():
    print(f"{name}: Rank {info[0]}, Life Expectancy {info[1]}")

